import React, { useReducer } from "react";
import "./App.css";

function reducer(state, action) {}
const App = () => {
  const [count, dispatch] = useReducer(reducer, 0);

  return (
    <div>
      <div>count: {count}</div>
      <button onClick={() => dispatch(1)}>increment</button>
      <button onClick={() => dispatch(2)}>decrement</button>
    </div>
  );
};
export default App;
